import PropTypes from 'prop-types';
import React, { useRef } from 'react';
import { Link } from 'react-router-dom';

// material-ui
import { makeStyles, useTheme } from '@material-ui/styles';
import {
    Box,
    Button,
    Chip,
    Dialog,
    DialogActions,
    DialogContent,
    Divider,
    Grid,
    IconButton,
    List,
    ListItem,
    ListItemText,
    Slide,
    Stack,
    Tab,
    Table,
    TableBody,
    TableCell,
    TableHead,
    TableRow,
    Tabs,
    TextField,
    Typography
} from '@material-ui/core';
import {
    Timeline,
    TimelineDot,
    TimelineItem,
    TimelineConnector,
    TimelineContent,
    TimelineOppositeContent,
    TimelineSeparator
} from '@material-ui/lab';

// third-party
import ReactToPrint from 'react-to-print';

// project imports
import MainCard from 'ui-component/cards/MainCard';
import AnimateButton from 'ui-component/extended/AnimateButton';
import SubCard from 'ui-component/cards/SubCard';
import Logo from 'ui-component/Logo';
import { gridSpacing } from 'store/constant';

// assets
import CalendarTodayTwoToneIcon from '@material-ui/icons/CalendarTodayTwoTone';
import DeleteTwoToneIcon from '@material-ui/icons/DeleteTwoTone';
import DescriptionTwoToneIcon from '@material-ui/icons/DescriptionTwoTone';
import EmailTwoToneIcon from '@material-ui/icons/EmailTwoTone';
import FiberManualRecordIcon from '@material-ui/icons/FiberManualRecord';
import LocalShippingTwoToneIcon from '@material-ui/icons/LocalShippingTwoTone';
import PhoneAndroidTwoToneIcon from '@material-ui/icons/PhoneAndroidTwoTone';
import ReceiptTwoToneIcon from '@material-ui/icons/ReceiptTwoTone';

// style constant
const useStyles = makeStyles((theme) => ({
    orderDetailsBox: {
        backgroundColor: theme.palette.background.default,
        paddingTop: '0px',
        paddingBottom: '0px'
    },
    primaryTail: {
        backgroundColor: theme.palette.primary.main
    },
    secondaryTail: {
        backgroundColor: theme.palette.grey[400]
    },
    orderDetails: {
        flex: '3'
    },
    timelineDot: {
        padding: '0px',
        '& > svg': {
            width: '14px',
            height: '14px'
        },
        [theme.breakpoints.down('sm')]: {
            display: 'none'
        }
    },
    timeline: {
        '& > li': {
            marginBottom: '14px',
            [theme.breakpoints.down('sm')]: {
                flexDirection: 'column',
                '& > div': {
                    paddingLeft: '0px',
                    paddingRight: '0px'
                },
                '& > div:first-child': {
                    textAlign: 'left'
                }
            }
        },
        [theme.breakpoints.down('sm')]: {
            padding: '0px'
        }
    },
    accountTab: {
        '& a': {
            minHeight: 'auto',
            minWidth: '10px',
            padding: '12px 8px',
            marginRight: '18px',
            color: theme.palette.grey[600],
            display: 'flex',
            flexDirection: 'row',
            alignItems: 'center',
            justifyContent: 'center'
        },
        '& a.Mui-selected': {
            color: theme.palette.primary.main
        },
        '& a > svg': {
            marginBottom: '0px !important',
            marginRight: '10px'
        }
    },
    userAddDialog: {
        '&>div:nth-child(3)': {
            justifyContent: 'flex-end',
            '&>div': {
                margin: '0px',
                borderRadius: '0px',
                maxWidth: '450px',
                maxHeight: '100%',
                height: '100vh'
            }
        }
    },
    statTitle: {
        backgroundColor: theme.palette.background.default,
        '& + div': {
            marginBottom: '10px'
        }
    },
    invoiceTable: {
        '& tr:last-child td': {
            borderBottom: 'none'
        },
        '& thead tr th': {
            borderBottom: 'none'
        },
        '& th:first-child, & td:first-child': {
            paddingLeft: '40px',
            [theme.breakpoints.down('sm')]: {
                paddingLeft: '20px'
            }
        },
        '& th:last-child, & td:last-child': {
            paddingRight: '70px',
            [theme.breakpoints.down('sm')]: {
                paddingRight: '50px'
            }
        }
    },
    invoiceCard: {
        maxWidth: '850px',
        margin: '0 auto 20px',
        '& > .MuiCardContent-root': {
            padding: '45px 40px',
            [theme.breakpoints.down('sm')]: {
                padding: '30px 20px'
            }
        }
    },
    customerHeadDetails: {
        '& > svg': {
            width: '15px',
            height: '15px',
            verticalAlign: 'text-top',
            marginRight: '5px',
            marginTop: '2px'
        }
    },
    invoiceLogo: {
        maxWidth: '100%',
        width: '120px',
        [theme.breakpoints.down('sm')]: {
            width: '70px'
        }
    },
    tableResponsive: {
        overflowX: 'auto'
    },
    totalBillAmount: {
        backgroundColor: theme.palette.mode === 'dark' ? theme.palette.dark.main : theme.palette.primary.light
    }
}));

// tab animation
const Transition = React.forwardRef((props, ref) => <Slide direction="left" ref={ref} {...props} />);

// tab content
function TabPanel({ children, value, index, ...other }) {
    return (
        <div role="tabpanel" hidden={value !== index} id={`simple-tabpanel-${index}`} aria-labelledby={`simple-tab-${index}`} {...other}>
            {value === index && (
                <Box
                    sx={{
                        p: 0
                    }}
                >
                    {children}
                </Box>
            )}
        </div>
    );
}

TabPanel.propTypes = {
    children: PropTypes.node,
    index: PropTypes.any.isRequired,
    value: PropTypes.any.isRequired
};

function a11yProps(index) {
    return {
        id: `simple-tab-${index}`,
        'aria-controls': `simple-tabpanel-${index}`
    };
}

// table data
function createData(product, description, quantity, amount, total) {
    return { product, description, quantity, amount, total };
}

const rows = [
    createData('Logo Design', 'lorem ipsum dolor sit amat, connecter adieu siccing eliot', '6', '$200.00', '$1200.00'),
    createData('Landing Page', 'lorem ipsum dolor sit amat, connecter adieu siccing eliot', '7', '$100.00', '$700.00'),
    createData('Admin Template', 'lorem ipsum dolor sit amat, connecter adieu siccing eliot', '5', '$150.00', '$750.00')
];

// ===========================|| ORDER DETAILS ||=========================== //

const OrderDetails = () => {
    const classes = useStyles();
    const theme = useTheme();
    const componentRef = useRef();

    // set selected tab
    const [value, setValue] = React.useState(0);
    const handleChange = (event, newValue) => {
        setValue(newValue);
    };

    // toggle write a review dialog
    const [open, setOpen] = React.useState(false);
    const handleClickOpenDialog = () => {
        setOpen(true);
    };

    const handleCloseDialog = () => {
        setOpen(false);
    };

    const sxDivider = {
        borderColor: theme.palette.primary.light
    };

    return (
        <MainCard>
            <Tabs
                value={value}
                indicatorColor="primary"
                textColor="primary"
                onChange={handleChange}
                variant="scrollable"
                className={classes.accountTab}
                aria-label="simple tabs example"
                sx={{ mb: 3 }}
            >
                <Tab icon={<DescriptionTwoToneIcon />} component={Link} to="#" label="Details" {...a11yProps(0)} />
                <Tab icon={<ReceiptTwoToneIcon />} component={Link} to="#" label="Invoice" {...a11yProps(1)} />
                <Tab icon={<LocalShippingTwoToneIcon />} component={Link} to="#" label="Status" {...a11yProps(2)} />
            </Tabs>

            {/* tab - details */}
            <TabPanel value={value} index={0}>
                <Grid container spacing={gridSpacing}>
                    <Grid item xs={12}>
                        <SubCard title="Customer" secondary={<Typography variant="subtitle1">Placed on 12.07.2018 10:00</Typography>}>
                            <Grid container spacing={gridSpacing}>
                                <Grid item xs={12}>
                                    <Grid container spacing={3}>
                                        <Grid item>
                                            <Typography variant="body2" className={classes.customerHeadDetails}>
                                                <CalendarTodayTwoToneIcon /> Sophia Hale
                                            </Typography>
                                        </Grid>
                                        <Grid item>
                                            <Typography variant="body2" className={classes.customerHeadDetails}>
                                                <PhoneAndroidTwoToneIcon /> 070 123 4567
                                            </Typography>
                                        </Grid>
                                        <Grid item>
                                            <Typography variant="body2" className={classes.customerHeadDetails}>
                                                <EmailTwoToneIcon /> example@mail.com
                                            </Typography>
                                        </Grid>
                                    </Grid>
                                </Grid>
                                <Grid item xs={12}>
                                    <Divider sx={sxDivider} />
                                </Grid>
                                <Grid item xs={12}>
                                    <Grid container spacing={gridSpacing}>
                                        <Grid item xs={12} sm={4}>
                                            <Grid container spacing={2}>
                                                <Grid item xs={12}>
                                                    <Typography variant="h4">Payment method</Typography>
                                                </Grid>
                                                <Grid item xs={12}>
                                                    <Grid container spacing={1}>
                                                        <Grid item xs={12}>
                                                            <Typography variant="h6">Credit Card</Typography>
                                                        </Grid>
                                                        <Grid item xs={12}>
                                                            <Typography variant="subtitle1">
                                                                Transaction ID : &nbsp;
                                                                <Typography component="span" variant="body2">
                                                                    000001-TXT
                                                                </Typography>
                                                            </Typography>
                                                        </Grid>
                                                        <Grid item xs={12}>
                                                            <Typography variant="subtitle1">
                                                                Amount : &nbsp;
                                                                <Typography component="span" variant="body2">
                                                                    $2500
                                                                </Typography>
                                                            </Typography>
                                                        </Grid>
                                                    </Grid>
                                                </Grid>
                                            </Grid>
                                        </Grid>
                                        <Grid item xs={12} sm={4}>
                                            <Grid container spacing={2}>
                                                <Grid item xs={12}>
                                                    <Typography variant="h4">Shipping method</Typography>
                                                </Grid>
                                                <Grid item xs={12}>
                                                    <Grid container spacing={1}>
                                                        <Grid item xs={12}>
                                                            <Typography variant="h6">Carrier</Typography>
                                                        </Grid>
                                                        <Grid item xs={12}>
                                                            <Typography variant="subtitle1">
                                                                Tracking Code : &nbsp;
                                                                <Typography component="span" variant="body2">
                                                                    FX-012345-6
                                                                </Typography>
                                                            </Typography>
                                                        </Grid>
                                                        <Grid item xs={12}>
                                                            <Typography variant="subtitle1">
                                                                Date : &nbsp;
                                                                <Typography component="span" variant="body2">
                                                                    12.15.2018
                                                                </Typography>
                                                            </Typography>
                                                        </Grid>
                                                    </Grid>
                                                </Grid>
                                            </Grid>
                                        </Grid>
                                        <Grid item xs={12} sm={4}>
                                            <Grid container spacing={2}>
                                                <Grid item xs={12}>
                                                    <Typography variant="h4" />
                                                </Grid>
                                                <Grid item xs={12}>
                                                    <Grid container spacing={1}>
                                                        <Grid item xs={12}>
                                                            <Typography variant="subtitle1">
                                                                Fulfillment status : &nbsp;
                                                                <Typography component="span" variant="body2">
                                                                    Delivered
                                                                </Typography>
                                                            </Typography>
                                                        </Grid>
                                                        <Grid item xs={12}>
                                                            <Typography variant="subtitle1">
                                                                Payment status : &nbsp;
                                                                <Chip label="Paid" variant="outlined" size="small" color="success" />
                                                            </Typography>
                                                        </Grid>
                                                    </Grid>
                                                </Grid>
                                            </Grid>
                                        </Grid>
                                    </Grid>
                                </Grid>
                                <Grid item xs={12}>
                                    <Divider sx={sxDivider} />
                                </Grid>
                                <Grid item xs={12}>
                                    <Grid container spacing={gridSpacing}>
                                        <Grid item sm={4}>
                                            <Grid container spacing={2}>
                                                <Grid item xs={12}>
                                                    <Typography variant="h4">Billing address</Typography>
                                                </Grid>
                                                <Grid item xs={12}>
                                                    <Grid container spacing={0}>
                                                        <Grid item xs={12}>
                                                            <Typography variant="subtitle1">
                                                                First name : &nbsp;
                                                                <Typography component="span" variant="body2">
                                                                    Joseph
                                                                </Typography>
                                                            </Typography>
                                                        </Grid>
                                                        <Grid item xs={12}>
                                                            <Typography variant="subtitle1">
                                                                Last name : &nbsp;
                                                                <Typography component="span" variant="body2">
                                                                    William
                                                                </Typography>
